.calendar {
  display: flex;
  flex-wrap: wrap;
  gap: $gap;
  padding: 0 $paddingCalendar;
  width: $widthCalendar;

  @each $name, $value in $day-start {
    &-start-day--#{$name} &__day:first-child {
      margin-left: $value;
    }
  }

  @for $num-day from 28 to 31 {
    &-month-length--#{$num-day} &__day:nth-child(n + #{$num-day + 1}) {
      display: none;
    }
  }

  &__day {
    border: 1px solid black;
    @extend %day-size;
    cursor: pointer;
    background-color: $colorGreyDay;
    transition: transform 500ms, background-color 500ms;

    @for $day from 1 through 31 {
      &:nth-child(#{$day})::before {
        content: "#{$day}";
        display: block;
        width: 100%;
        text-align: center;
        line-height: 100px;
        font-size: 30px;
      }
    }

    &:hover {
      transform: translateY(-20px);
      background-color: pink;
    }
  }
}

